import React from "react";
import './Input.css'

const Input=({bot})=>{
    return(
        <div className="btm">
            <div className="input">
            <input
                type="text"
                id="input_text"
                placeholder="Enter your Message"/>
            </div>
            <div className="btn">
                <button className="send-btn">
                    <i className="fa fa-paper-plane"></i>Send
                </button>
            </div>
        </div>
        
    )
}

export default Input;
